#### Key Equations and Pseudocode Snippets

1. **Counting Vowels in a Word**
   ```plaintext
   Procedure countSomething(Z)
       i = 1
       A = 0
       while (i <= Z.LetterCount) {
           if (i^th letter of Z.Word is vowel) {
               A = A + 1
           }
       }
       return (A)
   End countSomething
   ```

2. **Finding Maximum Price**
   ```plaintext
   Procedure findItem(Y)
       maxPrice = 0
       while (Card Y has more items) {
           Read an item Z from ItemList of card Y
           if (maxPrice < Z.Price) {
               maxPrice = Z.Price
           }
       }
       return (maxPrice)
   End findItem
   ```

3. **Calculating Fraction of Students**
