   fracTrue = countPerSub / countOverall
   ```

4. **Checking Conditions**
   ```plaintext
   if (X.Total >= 180) {
       countOverall = countOverall + 1
       if (X.Physics >= 60 and X.Chemistry >= 60 and X.Mathematics >= 60) {
           countPerSub = countPerSub + 1
       }
   }
   ```

5. **Finding the Difference in Years**
   ```plaintext
   Procedure doSomething(Table 2)
       A = 2050, B = 2050
       while (Table 2 has more rows) {
           Read the first row Z from Table 2
           if (Z.Year < A) {
               B = A
               A = Z.Year
           }
           if (Z.Year > A and Z.Year < B) {
               B = Z.Year
           }
       }
       return (B - A)
   End doSomething
   ```

